import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Boutique from "./pages/Boutique";
import Home from "./pages/Home";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="*" element={<Home />} />
        <Route path="/boutique" element={<Boutique />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
